import React from 'react';
import './App.scss';
import { ArticlesList, Footer, Header } from './components';

const App: React.FC<unknown> = () => {
  return (
    <div className="max-w-[1280px] mx-auto">
      <Header />
      <ArticlesList />
      <Footer />
    </div>
  );
};

export default App;
